import React, { useContext } from 'react';
import {Route, Redirect} from 'react-router-dom';

function PrivateRoute({component: Component, ...rest}) {
    return (
        <Route 
            {...rest} 
            render={props => 
                localStorage.getItem("token") ? 
                (
                <Component {...props} />
            ) : (
            <Redirect
                to="/home"
              />
            )
        } 
        />
    );
}
export default PrivateRoute;
